configure:
  commands:
    end:
      new_state: exec
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: switch(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: switch(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
